overview.description:
The Council is seeking a range of Providers to deliver Public Health services in Primary Care.


Providers will work in partnership with the Council, the Council’s representative organisation (currently the Live Life Well Service) and other providers to create and develop a Programme that:


Promotes prevention, early intervention and self-care for the people of Sunderland;


Ensures key Public Health services and interventions are accessible and equitable;


Ensures key Public Health services and interventions are of high quality, safe, effective and provide value for money;


Ensures Service Users are provided with or referred to services that are consistent with the Contract.


IMPORTANT INFORMATION


This solution, “the Provision Public Health Services in Primary Care” was previously advertised by Sunderland City Council via the NEPO Portal.  The Council has contacted all Providers contracted to this solution advising that the Council has changed its e-Procurement system to a new system called Open.


Please note, any Provider that has previously applied and has successfully been awarded a contract need not apply to this opportunity.


Any new Provider wishing to apply for this solution, the Provision of Public Health Services in Primary Care are required to access the documentation as attached to understand requirements to deliver this service.
